import { Switch, Route, BrowserRouter as Router } from "react-router-dom";
import "./App.css";
import FirstStyle from "./pages/home.page";
import NavbarComponent from "./components/navbar.component";
import ContactUsComponent from "./components/contactUs.component";
import { TopicPage } from "./pages/topic.page";
import AuthorPage from "./pages/author.page";
import SearchPage from "./pages/search.page";
import ReadArticlePage from "./pages/read.article.page";
import AboutePage from "./pages/aboute.page";
import ContactUsPage from "./pages/conatactUs.page";
import DashbordPage from "./pages/dashbord.page";

function App() {
  return (
    <Router>
      <NavbarComponent />
      <Switch>
        <Route path="/" exact component={FirstStyle({ style: "1" })} />
        <Route path="/home2" exact component={FirstStyle({ style: "2" })} />
        <Route path="/Home3" exact component={FirstStyle({ style: "3" })} />
      </Switch>
      {/* <FirstStyle /> */}
      {/* <TopicPage />
      <AuthorPage />
      <SearchPage /> */}
      {/* <ReadArticlePage /> */}
      {/* <AboutePage /> */}
      {/* <ContactUsPage /> */}
      {/* <DashbordPage /> */}
      <ContactUsComponent />
    </Router>
  );
}

export default App;
